import React, { useEffect } from "react";
import { useState } from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import styles from "assets/jss/material-kit-react/views/landingPage.js";
import Button from "components/CustomButtons/Button.js";
// import HeaderLinks from "components/Header/HeaderLinks.js";
import Parallax from "components/Parallax/Parallax.js";
import Card from "components/Card/Card.js";
import {getMega} from '../../Services/Pool'

import _ from "lodash";



const dashboardRoutes = [];
const useStyles = makeStyles(styles);


export default function States(props) {
    const classes = useStyles();

    const [states1, setStates] = useState();
    const history = useHistory();

    useEffect(async () => {
        const poolsdata = await getMega();
        console.log('hello',poolsdata)
        let states = _.map(poolsdata.data.s, (state, index) => {
          return { label: state.i.sn, abbr: state.i.s, key: index };
        });
        if (states && !_.isEmpty(states)) {
          setStates(states);
        }
        console.log("states data", states);
      }, []);


  const { ...rest } = props;
  return (
    <div>
      <Header
        color="transparent"
        routes={dashboardRoutes}
        // rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 90,
          color: "grey",
        }}
        {...rest}
      />
      <Parallax filter image={require("assets/img/US-Map.jpg")}>
        <div className={classes.container}>
<card>
    <h1>Winning Numbers</h1>
    <div>
    {/* states1.map((y, index) => ( */}
            {/* <Button onClick={statesRoute} style={{ background: "#22223b", align: "center" }}>
              {y.label}, {y.abbr}
            </Button> */}
        <Button  style={{margin:'10px'}} variant="contained" color="Danger" href="#contained-buttons">0 Card Cash </Button>
        <Button style={{margin:'10px'}} variant="contained" color="Danger" href="#contained-buttons">The Pick  </Button>
        <Button style={{margin:'10px'}} variant="contained" color="Danger" href="#contained-buttons">Fantasy 0  </Button>
        <Button style={{margin:'10px'}} variant="contained" color="Danger" href="#contained-buttons">Pick 3  </Button>
        <Button style={{margin:'10px'}} variant="contained" color="Danger" href="#contained-buttons">All or Nothing Midday  </Button>
        <Button style={{margin:'10px'}} variant="contained" color="Danger" href="#contained-buttons">All or Nothing Evenning   </Button>
    </div>

</card>
        </div>
      </Parallax>
      <Card style={{width:'250px',display:'contents'}}>

      </Card>
      <Footer />
    </div>
  );
}
